def if_contains_anagrams(strings):
    def is_anagram(str1, str2):
        return sorted(str1.lower()) == sorted(str2.lower())

    count = 0
    for i in range(len(strings)-1):
        for j in range(i+1, len(strings)):
            if len(strings[i]) >= 3 and is_anagram(strings[i], strings[j]):
                count += 1
                if count >= 6:
                    return True
    return False
```
Note: The function `is_anagram` is a helper function that checks if two strings are anagrams, ignoring case. The main function `if_contains_anagrams` iterates through each pair of strings and checks if they are anagrams of length at least three. It keeps track of a count and returns True if the count exceeds or equals 6. Otherwise, it returns False.
